import React from 'react';
import './FormComponents.css'

export const Input =({
    type,
    id,
    value,
    required,
    additionalClass,
    name,
    placeholder,
    manipulationFunction

}) => {
    return(
        <input 
        type={type}
        id={id}
        value={value}
        required={required}
        className={`input-component ${additionalClass}`}
        name={name}
        placeholder={placeholder}
        onChange={manipulationFunction}
        autoComplete='off'
        />
    );
}

export const Button = ({
    id,
    name,
    type,
    additionalClass ='',
    textButton,
    manipulationFunction
}) => {
    return(
        <button 
        type={type}
        name={name}
        id={id}
        className={`button-component ${additionalClass}`}
        onClick={manipulationFunction}
        >
           {textButton}
        </button>
    )
}

export const Select = () =>{
    return(
        <select name="" id="">
            <option value="">Selecione</option>
        </select>
    );
}
